import React from "react";
import {
  BrowserRouter as Router,
  Route,
  Switch,
  Redirect
} from "react-router-dom";
import HomePage from "./Pages/HomePage";
import ResetPwPage from "./Pages/ResetPwPage";
import ForgotPasswordPage from "./Pages/ForgotPasswordPage";
import CreateEvent from "./Pages/dashBoard/CreateEvent/CreateEvent";
import CreditsPage from "./Pages/dashBoard/Credits/CreditsPage";
import ThankYou from "./Pages/dashBoard/Congrats/ThankYou";
import Congrats from "./Pages/dashBoard/Congrats/Congrats";
import Order from "./Pages/dashBoard/Order/Order";
import Nav from "./Components/nav";
import Profile from "./Pages/dashBoard/Profile/Profile";

function Routes() {
  const accessToken = localStorage.getItem("access_token");

  return (
    <Router>
      {accessToken && <Nav />}
      <Switch>
        {accessToken || <Route exact path="/" component={HomePage} />}
        <Route exact path="/resetpwpage" component={ResetPwPage} />
        <Route
          exact
          path="/forgotpasswordpage"
          component={ForgotPasswordPage}
        />
        <Route exact path="/CreateEvent" component={CreateEvent} />
        <Route exact path="/CreditsPage" component={CreditsPage} />
        <Route exact path="/ThankYou" component={ThankYou} />
        <Route exact path="/Congrats" component={Congrats} />
        <Route exact path="/Order" component={Order} />
        <Route exact path="/Profile" component={Profile} />
        <Redirect to="/CreateEvent" />
      </Switch>
    </Router>
  );
}

export default Routes;
